import '../App.css';
import {Card, Button} from 'react-bootstrap';

class RecommendedCourse extends React.Component {
    render() {
        return (

            <Card style={{width: '100%', marginTop: '5px', marginBottom: '5px', backgroundColor: '#F7B7B7'}}>
              <Card.Body>
                <Card.Title align={"center"}>Title</Card.Title>
                <Card.Subtitle align={"center"} className="mb-2 text-muted">Course Number</Card.Subtitle>
                <Card.Text>Data</Card.Text>
                <Button align={"right"}>Add all to Cart</Button>
              </Card.Body>

              </Card>

        )
      }
}

export default RecommendedCourse
